#####################################################################
#
# CSCB58 Summer 2023 Assembly Final Project
# University of Toronto, Scarborough
#
# Student: Nathan Wong
#
# Bitmap Display Configuration:
# - Unit width in pixels: 4
# - Unit height in pixels: 4 
# - Display width in pixels: 256
# - Display height in pixels: 256 
# - Base Address for Display: 0x10008000 ($gp)
#
# Which milestones have been reached in this submission?
# (See the assignment handout for descriptions of the milestones)
# - Milestone 3 (all)
#
# Which approved features have been implemented for milestone 3?
# (See the assignment handout for the list of additional features)
# 1. Pick-up effects
# 2. Double Jump
# 3. Moving objects/pickups	
# 4. Win Condition  (reach top)		
# 5. Fail Condition (fall bottom)	
# 6. Moving Platforms			
#
# Link to video demonstration for final submission:
# - https://www.youtube.com/watch?v=EGSwUOPYerU
#
#####################################################################

# Draw/Tick definitions
.eqv BASE_ADDRESS 0x10008000
.eqv SCREEN_WIDTH 64		# Display width / unit width
.eqv SCREEN_HEIGHT 64	# Diplay height / unit height
.eqv SLEEP 40
.eqv SLEEP_SLOW 100

.eqv COLOR_RED 0xff0000
.eqv COLOR_GREEN 0x00ff00
.eqv COLOR_DARK_BLUE 0x0000ff
.eqv COLOR_BLUE 0x00ffff
.eqv COLOR_WHITE 0xffffff
.eqv COLOR_BACKGROUND 0x000000

# Input 
.eqv KEY_W 119
.eqv KEY_A 97
.eqv KEY_S 115
.eqv KEY_D 100
.eqv KEY_P 112

# Physics (working with the framebuffer - negative is up and positive is down)
.eqv GRAV_ACCEL 1	# the amount of gravitational acceleration applied at each tick
.eqv TERM_VEL 1	# how many pixels per tick can we fall at
.eqv TERM_VEL_UP -6 	# at most how many pixels per tick can we jump up at

# Player
.eqv PLAYER_WIDTH 3
.eqv PLAYER_HEIGHT 4

# Init Vars
.eqv PLAYER_START_X 5
.eqv PLAYER_START_Y 55
.eqv PLATFORM1_START_X 0
.eqv PLATFORM1_START_Y 62
.eqv PLATFORM2_START_X 20
.eqv PLATFORM2_START_Y 52
.eqv PLATFORM3_START_X 30
.eqv PLATFORM3_START_Y 42
.eqv PLATFORM4_START_X 5
.eqv PLATFORM4_START_Y 22

# Pickups
.eqv PICKUP_SIZE 2
.eqv PICKUP_TIME_X 10
.eqv PICKUP_TIME_Y 50
.eqv PICKUP_DOUBLE_X 25
.eqv PICKUP_DOUBLE_Y 30
.eqv PICKUP_INF_DJ_X 50
.eqv PICKUP_INF_DJ_Y 58
.eqv TIME_SLOW_AMT 25 # number of ticks with slowed time

.data

# Player variables
# PLAYER_POS: .word 0, 0		# store top-left player position as tuple (x,y)
# PLAYER_VERT_VEL: .word 0		# the vertical velocity of the player (+ve up, -ve down)
# PLAYER_ON_PLATFORM: .word 0	# 0 false, 1 true

# Level Objects
PLATFORM1: .word PLATFORM1_START_X, PLATFORM1_START_Y, 15		# (x,y, horizontal length, minx, maxx, moveDir)
PLATFORM2: .word PLATFORM2_START_X, PLATFORM2_START_Y, 15
PLATFORM3: .word PLATFORM3_START_X, PLATFORM3_START_Y, 15, 10, 40, 1
PLATFORM4: .word PLATFORM4_START_X, PLATFORM4_START_Y, 10
PICKUP_TIME: .word PICKUP_TIME_X, PICKUP_TIME_Y, 0 								# (x, y, pickedup, minx, maxx, moveDir)
PICKUP_DOUBLE: .word PICKUP_DOUBLE_X, PICKUP_DOUBLE_Y, 0, 10, 50, -1
PICKUP_INF_DJ: .word PICKUP_INF_DJ_X, PICKUP_INF_DJ_Y, 0, 10, 50, 1 

