 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 

.text
.globl main
main:

# Global Common Variables:
# s0 = game state (0-playing, 1-win, 2-lose)
# s1 = player x (bottom left)
# s2 = player y (bottom left)
# s3 = player grounded
# s4 = player vertical velocity
# s5 = time slow (positive number - decrement until 0)
# s6 = double jump state (0-ability not active, 1-available for double jump, 2-already jumped)
# s7 = player infinite double jump

# Init global vars
li $s0, 0
li $s1, PLAYER_START_X
li $s2, PLAYER_START_Y
li $s3, 0
li $s4, 0
li $s5, 0
li $s6, 0
li $s7, 0

TICK:

	beq $s0, 1, HAS_WON
	beq $s0, 2, HAS_LOST
	
	# ----------------------- Gravity ----------------------
	
	GRAVITY:
		jal APPLY_GRAVITY
		j CHECK_INPUT
		
	# -----------------------  Gravity ----------------------
	
	# ----------------------- Input Handlers ----------------------
	
	CHECK_INPUT: # Input Logic here
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	bne $t8, 1, COLLISION_AND_MOVEMENT # No keypress during this tick
	
	lw $t0, 4($t9) # t0 = key pressed during this tick
	
	CHECK_W_PRESS:
		beq $t0, KEY_W, W_PRESSED
	CHECK_A_PRESS:
		beq $t0, KEY_A, A_PRESSED
	CHECK_S_PRESS:
		beq $t0, KEY_S, S_PRESSED
	CHECK_D_PRESS:
		beq $t0, KEY_D, D_PRESSED
	CHECK_P_PRESS:				
		beq $t0, KEY_P, P_PRESSED
		
	j COLLISION_AND_MOVEMENT
		
	W_PRESSED:
		jal HANDLE_W_PRESSED
		j COLLISION_AND_MOVEMENT
	A_PRESSED:
		jal HANDLE_A_PRESSED
		j COLLISION_AND_MOVEMENT
	S_PRESSED:
		jal HANDLE_S_PRESSED
		j COLLISION_AND_MOVEMENT
	D_PRESSED:
		jal HANDLE_D_PRESSED
		j COLLISION_AND_MOVEMENT
	P_PRESSED:
		jal RESET
		j TICK_SLEEP
		
	# -------------------- End of Input Handlers  ------------------
	
	# ----------------------- Collision and Movement ----------------------
	
	COLLISION_AND_MOVEMENT:	
		jal CHECK_BOUNDS
		jal MOVE_OBJECTS
		jal CHECK_PLATFORM_COLLISION
		jal CHECK_OBJECT_COLLISION
		jal UPDATE_PLAYER_VERT
		
		j DRAW
		
	# ----------------------- End of Collision and Movement ----------------------
	
	# ----------------------- Drawing ----------------------
	
	DRAW: # Draw Order/Logic here (from lowest z-index to highest)
		jal CLEAR_SCREEN
		jal DRAW_PLATFORMS
		jal DRAW_PLAYER
		jal DRAW_PICKUPS
		
		j WIN_FAIL
		
	# -------------------- End of Drawing ------------------
	
	# ----------------------- Win/Fail Condition ----------------------
	
	WIN_FAIL:
		jal CHECK_WIN_FAIL
		j TICK_SLEEP
	
	HAS_WON:
		la $a0, WIN_SCREEN
		jal DRAW_SCREEN
		j CHECK_INPUT_IN_SCREEN
		
	HAS_LOST:
		la $a0, LOSE_SCREEN
		jal DRAW_SCREEN
		j CHECK_INPUT_IN_SCREEN
		
	CHECK_INPUT_IN_SCREEN:
		li $t9, 0xffff0000
		lw $t8, 0($t9)
		bne $t8, 1, TICK_SLEEP # No keypress during this tick
		lw $t0, 4($t9) # t0 = key pressed during this tick
		
	CHECK_P_PRESS_IN_SCREEN:				
		beq $t0, KEY_P, P_PRESSED_IN_SCREEN
		j TICK_SLEEP
		
	P_PRESSED_IN_SCREEN:
		jal RESET
		j TICK_SLEEP
	
	# ----------------------- End of Win/Fail Condition ----------------------
	
	TICK_SLEEP: # Sleep and restart the loop
	li $v0, 32
	bgtz $s5, TICK_SLEEP_SLOW
	li $a0, SLEEP
	syscall
	j DONE_SLEEP
	
	TICK_SLEEP_SLOW:
	li $a0, SLEEP_SLOW
	addi $s5, $s5, -1
	syscall
	
	DONE_SLEEP:
	
	j TICK
	
END:
	li $v0, 10
	syscall


# ----------------------- Input Handlers ----------------------

HANDLE_W_PRESSED:
	beq $s3, 0, NOT_GROUNDED
	li $s4, TERM_VEL_UP
	li $s3, 0
	jr $ra
	
	NOT_GROUNDED:		
	
	beq $s6, 2, NO_DJ
	beq $s6, 0, NO_DJ
	addi $s4, $s4, -4
	
	blt $s4, TERM_VEL_UP, ABOVE_TERM_VEL
	j NOT_ABOVE_TERM_VEL
	
	ABOVE_TERM_VEL:
	li $s4, TERM_VEL_UP
	
	NOT_ABOVE_TERM_VEL:
	li $s3, 0
	
	beq $s7, 1, NO_DJ
	li $s6, 2
	
	NO_DJ:
	jr $ra

HANDLE_A_PRESSED:
	addi $s1, $s1, -2
	jr $ra
	
HANDLE_S_PRESSED:
	addi $s2, $s2, 1
	jr $ra
	
HANDLE_D_PRESSED:
	addi $s1, $s1, 2
	jr $ra

# -------------------- End of Input Handlers ------------------

# ----------------------- Collision, Gravity, Movement ----------------------
	
APPLY_GRAVITY:
	beq $s4, TERM_VEL, TERM_VEL_REACHED
	addi $s4, $s4, GRAV_ACCEL
	TERM_VEL_REACHED:
	jr $ra
	
UPDATE_PLAYER_VERT:
	move $t0, $s4
	add $s2, $s2, $t0
	jr $ra
	
CHECK_BOUNDS:
	blt $s1, 0, LEFT_BOUND
	
	li $t0, SCREEN_WIDTH
	sub $t0, $t0, PLAYER_WIDTH
	
	bgt $s1, $t0, RIGHT_BOUND
	
	j CHECK_FALL
	
	LEFT_BOUND:
	li $s1, 0
	j CHECK_FALL
	
	RIGHT_BOUND:
	move $s1, $t0
	j CHECK_FALL
	
	
	CHECK_FALL:

	j DONE_CHECK_BOUNDS


	DONE_CHECK_BOUNDS:
	jr $ra
		
CHECK_PLATFORM_COLLISION: # Go through each platform if player intersects then set y position of player to 1 pixel above platform and 0 vert vel
	move $a0, $ra
	blt $s4, 0, DONE_CHECK_PLATFORM_COLLISION
	
	la $t0, PLATFORM1
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal CHECK_SINGLE_PLATFORM_COLLISION
	beq $v0, 1, DONE_CHECK_PLATFORM_COLLISION
	
	la $t0, PLATFORM2
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal CHECK_SINGLE_PLATFORM_COLLISION
	beq $v0, 1, DONE_CHECK_PLATFORM_COLLISION
	
	la $t0, PLATFORM3
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal CHECK_SINGLE_PLATFORM_COLLISION
	beq $v0, 1, DONE_CHECK_PLATFORM_COLLISION
	
	la $t0, PLATFORM4
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal CHECK_SINGLE_PLATFORM_COLLISION
	beq $v0, 1, DONE_CHECK_PLATFORM_COLLISION
	
	DONE_CHECK_PLATFORM_COLLISION:
	move $ra, $a0
	jr $ra
	
CHECK_SINGLE_PLATFORM_COLLISION: #bool(origRA, x, y, width) -- to avoid using the stack, store the caller's caller ra in a0
	# primitive cast down from player
	move $t3, $s1 # t3 = player x
	addi $t3, $t3, 1 # center ray
	move $t4, $s2 # t4 = player y
	addi $t4, $t4, PLAYER_HEIGHT # move to feet
	
	# Check on same level as platform
	bne $t4, $a2, NO_COLLISION
	
	# Check within x bounds
	blt $t3, $a1, NO_COLLISION
	add $t1, $a1, $a3
	bgt $t3, $t1, NO_COLLISION
	
	# Else we have collision. Stop downward velocity, set grounded, set double jump if needed
	COLLISION:
	li $s4, 0
	li $s3, 1
	
	# Set double jump if ability unlocked
	beq $s6, 0, COLLISION_NO_DJ
	li $s6, 1
	
	COLLISION_NO_DJ:
	li $v0, 1
	jr $ra

	NO_COLLISION:
	li $s3 0
	li $v0, 0
	jr $ra

		
CHECK_OBJECT_COLLISION: # Go through each object and check if it collides with player
	
	move $a0, $ra
	
	CHECK_PICKUP_TIME:
	
	# Check time pickup
	la $t0, PICKUP_TIME 
	lw $t1, 8($t0)
	beq $t1, 1, CHECK_PICKUP_DOUBLE
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	jal CHECK_SINGLE_PICKUP_COLLISION
	
	# If the time pickup is collided
	beq, $v0, 0, CHECK_PICKUP_DOUBLE
	li $s5, TIME_SLOW_AMT
	la $t0, PICKUP_TIME
	li $t1, 1
	sw $t1, 8($t0)
	
	CHECK_PICKUP_DOUBLE:
	
	# Check double jump pickup
	la $t0, PICKUP_DOUBLE
	lw $t1, 8($t0)
	beq $t1, 1, CHECK_PICKUP_INF_DJ
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	jal CHECK_SINGLE_PICKUP_COLLISION
	
	# If the double jump pickup is collided
	beq, $v0, 0, CHECK_PICKUP_INF_DJ
	li $s6, 1
	la $t0, PICKUP_DOUBLE
	li $t1, 1
	sw $t1, 8($t0)
	
	CHECK_PICKUP_INF_DJ:
	
	# Check inf dj pickup
	la $t0, PICKUP_INF_DJ
	lw $t1, 8($t0)
	beq $t1, 1, DONE_CHECK_OBJECTS
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	jal CHECK_SINGLE_PICKUP_COLLISION
	
	# If the inf dj pickup is collided 
	beq, $v0, 0, DONE_CHECK_OBJECTS
	li $s7, 1
	li $s6, 1
	la $t0, PICKUP_INF_DJ
	li $t1, 1
	sw $t1, 8($t0)
	
	DONE_CHECK_OBJECTS:
	move $ra, $a0
	jr $ra
	
CHECK_SINGLE_PICKUP_COLLISION: #(prevRA, x, y) --> ret in v0 1 if collision else 0

	move $t0, $a1
	addi $t0, $t0, 2 # right side x of pickup
	addi $a1, $a1, -1 # left side x of pickup
	
	move $t1, $a2
	addi $t1, $t1, 2 # bottom side y of  pickup
	addi $a2, $a2, -1 # top side y of pickup
	
	move $t3, $s1 # t3 = player x
	addi $t3, $t3, 1 # center player x
	move $t4, $s2 # t4 = player y
	addi $t4, $t4, 2 # move to middle y
	
	blt $t3, $a1, NO_PICKUP_COLLISION
	bgt $t3, $t0, NO_PICKUP_COLLISION
	blt $t4, $a2, NO_PICKUP_COLLISION
	bgt $t4, $t1, NO_PICKUP_COLLISION
	
	PICKUP_COLLISION:
	li $v0 1
	jr $ra
	
	NO_PICKUP_COLLISION:
	li $v0, 0
	jr $ra
		
# ----------------------- End of Collision, Gravity, Movement ----------------------

# ----------------------- Moving Platforms, Objects ----------------------

MOVE_OBJECTS:
	
	move $a0, $ra
	
	la $a1, PLATFORM3
	jal MOVE_GENERIC_OBJ
	
	la $a1, PICKUP_DOUBLE
	jal MOVE_GENERIC_OBJ
	
	move $ra, $a0
	jr $ra
	
MOVE_GENERIC_OBJ: #(prevRA, address)

	lw $t0, 0($a1) #x
	lw $t1, 12($a1) #min
	lw $t2, 16($a1) #max
	lw $t3, 20($a1) #dir
	
	ble $t0, $t1, MOVE_BOUND
	bge $t0, $t2, MOVE_BOUND
	j MOVE_OBJ_IN_DIR
	
	MOVE_BOUND:
	li $t4, -1
	mult $t3, $t4
	mflo $t3
	sw $t3, 20($a1)
	
	MOVE_OBJ_IN_DIR:
	add $t0, $t0, $t3
	sw $t0, 0($a1)
	
	jr $ra

# ----------------------- End of Moving Platforms, Objects ----------------------
	
# ----------------------- Drawing ----------------------

CLEAR_SCREEN: # Clear the screen to prepare for draw
	li $t0, BASE_ADDRESS
	li $t1, SCREEN_WIDTH
	li $t2, COLOR_BACKGROUND
	li $t3, 4
	mult $t1, $t1
	mflo $t1
	mult $t1, $t3
	mflo $t1
	add $t1, $t0, $t1
	
	CLEAR_SCREEN_LOOP:
		bgt $t0, $t1, DONE_CLEAR_SCREEN
		sw $t2, 0($t0)
		addi $t0, $t0, 4
		j CLEAR_SCREEN_LOOP
	DONE_CLEAR_SCREEN:
		jr $ra
		
DRAW_PLATFORMS:

	# We have single nested function call - to avoid stack, store ra in a0
	move $a0, $ra
	
	# Platform 1
	la $t0, PLATFORM1
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal DRAW_SINGLE_PLATFORM
	
	la $t0, PLATFORM2
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal DRAW_SINGLE_PLATFORM
	
	la $t0, PLATFORM3
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal DRAW_SINGLE_PLATFORM
	
	la $t0, PLATFORM4
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	lw $a3, 8($t0)
	jal DRAW_SINGLE_PLATFORM
	
	move $ra, $a0
	jr $ra
	
DRAW_SINGLE_PLATFORM: #(origRA, x, y, width) -- to avoid using the stack, store the caller's caller ra in a0
	
	# Get t0 to (x,y)
	li $t0, SCREEN_WIDTH
	li $t2, 4
	
	mult $t0, $a2
	mflo $t0
	add $t0, $t0, $a1
	mult $t0, $t2
	mflo $t0
	addi $t0, $t0, BASE_ADDRESS
	
	# t3 end condition
	move $t3, $a3
	mult $t2, $t3
	mflo $t3
	add $t3, $t0, $t3

	# t4 platform color
	li $t4, COLOR_RED
	
	DRAW_SINGLE_PLATFORM_LOOP:
		bgt $t0, $t3, END_DRAW_SINGLE_PLATFORM_LOOP
		
		sw $t4, 0($t0)
		addi $t0, $t0, 4
		
		j DRAW_SINGLE_PLATFORM_LOOP
	
	END_DRAW_SINGLE_PLATFORM_LOOP:
		jr $ra
		
		
DRAW_PLAYER: # Draw player character at the current PLAYER_POS
	
	# t1=x, t2=y, t3=color, t6 secondary color
	move $t1, $s1
	move $t2, $s2
	li $t3, COLOR_GREEN
	li $t7, COLOR_GREEN
	
	bne $s6, 1, DRAW_PLAYER_INF_JUMP
	li $t7, COLOR_WHITE
	
	DRAW_PLAYER_INF_JUMP:
	beqz $s7, DRAW_PLAYER_BODY
	li $t3, COLOR_RED
	
	DRAW_PLAYER_BODY:
	
	# t4=framebuffer, t5=(x,y)
	li $t4, BASE_ADDRESS
	li $t5, SCREEN_WIDTH
	li $t6, 4
	mult $t5, $t2 		# y*width
	mflo $t5			
	add $t5, $t5, $t1		# y*width + x
	mult $t5, $t6		# (y*width + x)*4
	mflo $t5
	
	add $t5, $t5, $t4		# Offset by base address
	
	sw $t3, 0($t5)		# Draw pixel
	sw $t3, 4($t5)
	sw $t3, 8($t5)
	
	li $t6, COLOR_DARK_BLUE
	addi $t5, $t5, 256
	sw $t6, 0($t5)
	sw $t3, 4($t5)
	sw $t6, 8($t5)
	
	addi $t5, $t5, 256
	sw $t3, 0($t5)
	sw $t3, 4($t5)
	sw $t3, 8($t5)
	
	addi $t5, $t5, 256
	sw $t7, 0($t5)
	sw $t7, 8($t5)
	
	jr $ra				# Done
	
	
DRAW_PICKUPS:
	move $a0, $ra

	DRAW_PICKUP_TIME:
	la $t0, PICKUP_TIME
	lw $t1, 8($t0)
	beq $t1, 1, DRAW_PICKUP_DOUBLE
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	li $a3, COLOR_RED
	jal DRAW_SINGLE_PICKUP
	
	DRAW_PICKUP_DOUBLE:
	la $t0, PICKUP_DOUBLE
	lw $t1, 8($t0)
	beq $t1, 1, DRAW_PICKUP_INF_DJ
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	li $a3, COLOR_GREEN
	jal DRAW_SINGLE_PICKUP
	
	DRAW_PICKUP_INF_DJ:
	la $t0, PICKUP_INF_DJ
	lw $t1, 8($t0)
	beq $t1, 1, DONE_DRAW_PICKUPS
	lw $a1, 0($t0)
	lw $a2, 4($t0)
	li $a3, COLOR_BLUE
	jal DRAW_SINGLE_PICKUP
	
	DONE_DRAW_PICKUPS:
	move $ra, $a0
	jr $ra
	
DRAW_SINGLE_PICKUP: #(prevRA, x, y, color)
	# Get t0 to (x,y)
	li $t0, SCREEN_WIDTH
	li $t2, 4
	
	mult $t0, $a2
	mflo $t0
	add $t0, $t0, $a1
	mult $t0, $t2
	mflo $t0
	addi $t0, $t0, BASE_ADDRESS
	
	sw $a3 0($t0)
	sw $a3 4($t0)
	sw $a3 256($t0)
	sw $a3 260($t0)
	
	jr $ra

DRAW_SCREEN: #(address(screen))
	li $t0, BASE_ADDRESS
	li $t1, SCREEN_WIDTH
	li $t3, 4
	mult $t1, $t1
	mflo $t1
	mult $t1, $t3
	mflo $t1
	add $t1, $t0, $t1

	DRAW_SCREEN_LOOP:
		bgt $t0, $t1, DONE_DRAW_SCREEN
		lw $t2, 0($a0)
		sw $t2, 0($t0)
		addi $t0, $t0, 4
		addi $a0, $a0, 4
		j DRAW_SCREEN_LOOP
	DONE_DRAW_SCREEN:
		jr $ra

# -------------------- End of Drawing ------------------

# -------------------- Reset ------------------

RESET: # Set all variables back to their original values

	RESET_MOVING_PLATFORMS: # Reset platform position for moving platforms
	la $t0, PLATFORM3
	li $t1, PLATFORM3_START_X
	sw $t1, 0($t0)
	li $t1, 1
	sw $t1, 20($t0)
	
	RESET_PICKUPS: # Set pickup status back to false of all pickups
	la $t0, PICKUP_TIME
	li $t1, 0
	sw $t1, 8($t0)
	
	la $t0, PICKUP_DOUBLE
	li $t1, PICKUP_DOUBLE_X
	sw $t1, 0($t0)
	li $t1, 0
	sw $t1, 8($t0)
	li $t1, -1
	sw $t1, 20($t0)
	
	la $t0, PICKUP_INF_DJ
	li $t1, 0
	sw $t1, 8($t0)
	
	RESET_PLAYER: # Reset player variables
	li $s1, PLAYER_START_X
	li $s2, PLAYER_START_Y
	li $s3, 0
	li $s4, 0
	li $s5, 0
	li $s6, 0
	li $s7, 0
	
	RESET_GAME_STATE:
	li $s0, 0

	jr $ra

# -------------------- End of Reset ------------------

# ----------------------- Win/Fail Condition ----------------------
	
CHECK_WIN_FAIL:
	blt $s2, 0, WIN #Player has reached the top -- they win!
	bgt $s2, SCREEN_HEIGHT, FAIL # Player fell into the void -- they lose :(
	j DONE
		
	WIN:
	li $s0, 1
	j DONE
	
	FAIL:
	li $s0, 2
	j DONE
			
	DONE:
	jr $ra
	
# ----------------------- End of Win/Fail Condition ----------------------
